const extractor=()=>({get_posts:async function(page=1,request=null,args=null){return[]},get_post:async function(id,request=null,args=null){return await fetch("https://api.github.com/gists/"+id).then((res=>res.json())).then((data=>({title:data.description,author:data.owner.login,url:"https://gist.github.com/"+data.owner.login+"/"+id,id:id,dt:data.created_at,image:"/favicon.svg",page:"/discover/gist/"+id}))).catch((err=>null))}});